import React from 'react';
import ReactDOM from 'react-dom/client';
import { store, App } from './App';

const renderApp = () => {
  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(<App />);
}

renderApp();
store.subscribe(renderApp);
